
CREATE TABLE IF NOT EXISTS `vendas` (
  `id` int NOT NULL AUTO_INCREMENT,
  `data_venda` date NOT NULL,
  `nome_produto` varchar(255) NOT NULL,
  `quantidade` int NOT NULL,
  `preco_unitario` decimal(10,2) NOT NULL,
  `total_venda` decimal(10,2) NOT NULL,
  `metodo_pagamento` enum('Cartão','Dinheiro','Transferência') NOT NULL,
  `tipo_pagamento` enum('À Vista','Parcelado') NOT NULL,
  `nome_cliente` varchar(100) NOT NULL,
  `vendedor` varchar(100) NOT NULL,
  `nome_loja` varchar(100) NOT NULL,
  `cidade_loja` varchar(100) NOT NULL,
  `estado_loja` varchar(2) NOT NULL,
  `localizacao` varchar(255) NOT NULL,
  `status` enum('Concluida','Cancelada','Pendente') NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


